import React from "react";
import { Prism as SyntaxHighlighter } from "react-syntax-highlighter";
import { vscDarkPlus } from "react-syntax-highlighter/dist/esm/styles/prism";

export default function NotebookPreview({ notebookJSON }) {
  let cells = [];
  try {
    const nb = JSON.parse(notebookJSON);
    cells = nb.cells.filter(cell => cell.cell_type === "code").slice(0, 3);
  } catch {
    return <div>Invalid notebook format.</div>;
  }

  return (
    <div>
      {cells.map((cell, idx) => (
        <div
          key={idx}
          style={{
            border: "1px solid #e1e4e8",
            borderRadius: 6,
            marginBottom: 16,
            background: "#fff",
            padding: 0,
            overflow: "hidden"
          }}
        >
          <div style={{
            background: "#f6f8fa",
            padding: "4px 12px",
            fontFamily: "monospace",
            color: "#6a737d"
          }}>
            In [{cell.execution_count || " "}]:
          </div>
          <SyntaxHighlighter
            language="python"
            style={vscDarkPlus}
            customStyle={{ margin: 0, padding: 12, background: "#fff" }}
          >
            {cell.source.join("")}
          </SyntaxHighlighter>
        </div>
      ))}
    </div>
  );
}
